import * as React from 'react';
import { ImageBackground, StyleSheet } from 'react-native';

import { View, Text } from './Themed';

const alqicon = { uri: '../assets/images/alquilibro-icon.png'}

export default function NavBar() {

    return (

        <View style={styles.container}>
            <View style={styles.iconContainer}>
                <ImageBackground style={styles.alquilibroIcon} source={alqicon} >
                </ImageBackground>    
            </View>
            <View style={styles.textContainer}>
            <Text style={styles.title}>Alquilibro</Text>
            </View>
        </View>
    )
};

const styles = StyleSheet.create({
    container: {
        display: 'flex',
        flexDirection: 'row',
        alignItems: 'center',
        padding: '16px',
        width: '411px', 
        height: '56px',
        left: '0px',
        top: '24px',
        backgroundColor: '#7ECA9C'
    },
    title: {
        fontFamily: 'Roboto',
        fontStyle: 'normal',
        fontWeight: '500',
        fontSize: 20,
        lineHeight: 24,
        letterSpacing: 0.15,
        color: '#1C1427'
    },
    textContainer: {
        position: 'absolute',
        width: '189px',
        height: '24px',
        left: '86px',
        top: '16px',
        backgroundColor: '#7ECA9C'

    },
    iconContainer: {
        position: 'absolute',
        width: '37px',
        height: '37px',
        left: '16px',
        top: '9.5px'
    },
    alquilibroIcon: {
        position: 'absolute',
        width: '24px',
        height: '25px',
        left: '22px',
        top: '15px'
    }
  });
